import React from 'react'
import logo from '../assets/logo.svg';
import github from '../assets/github.svg';
import facebook from '../assets/facebook.svg';
import dribbble from '../assets/dribbble.svg';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

function Content() {

  return (
    <div className="hero min-h-screen mt-10 rounded-xl bg-base-300">
      <div className="max-2xl:hero-content text-center max-sm:text-left">
        <div className="items-center max-w-2xl">
            <img src={logo}  alt='logo' className='w-40 h-40 m-auto'/>
          <h1 className="max-2xl:text-3xl font-bold max-sm:text-xl p-2">Hi, I'm Feby Febri Yansyah</h1>
          <p className="max-2xl:py-6 text-base  min-sm:py-6 p-2">I’m from Indonesia and I have been working as a UI UX designer for more than 2 years. I’ve worked for a NTC ( Network Tecnology Consultan ) as a Mobile designer and Mobile Developer for 1 years and currently I Freelancer In Upwork and right now I am looking forward to collaborate with you!</p>
          <div className='inline'>
            <img src={github} alt='github' width={40} height={40}/>
            <img src={facebook} alt='facebook'/>
            <img src={dribbble} alt='dribbble'/>
          </div>
        </div>
      </div>
    </div>
  )
}

export default Content
